import { Box, withStyles } from "@material-ui/core";

export default function BottomBar() {
  return (
    <Container>
      <Button>Start</Button>
    </Container>
  );
}

const Container = withStyles({
  root: {
    position: "absolute",
    bottom: 0,
    left: 0,
    right: 0,
    height: 100,
    borderTop: "1px solid lightgray",
  },
})(Box);

const Button = withStyles({
  root: {
    float: "right",
    backgroundColor: "#0e62cb",
  },
})(Box);
